import {
    SHOW_ERROR_MESSAGE,
    HIDE_ERROR_MESSAGE,
    HIDE_SUCCESS_MESSAGE,
    SHOW_SUCCESS_MESSAGE,
  } from "../constants/ActionTypes";


export const addNewHomework = (data) => {
  return (dispatch) => {
    let apiEndpoint = `/homeworks/addAndAssignNewHomework?access_token=${localStorage.token}`;
    classService.post(apiEndpoint, data).then((response) => {
      if (response) {
          console.log('response', response);
        // dispatch({ type: ADD_SUPPORT_COURS, payload: response.data });
      } 
